//--------------------------- PROGRAM LOGIC ---------------------------
//---------------------------------------------------------------------

class RNG {
    constructor(seed) {
        this.seed = seed;
        this.multiplier = 1664525;
        this.increment = 1013904223;
        this.modulus = Math.pow(2, 32);
    }

    next() {
        this.seed = (this.seed * this.multiplier + this.increment) % this.modulus;
        return this.seed / this.modulus;
    }
}


class CData {
    constructor(c) {
        this.c = c;
        this.pre = new Array(2);
        this.post = new Array(2);
  
        for (let i = 0; i < 2; i++) {
            this.pre[i] = new Array(SAMPLE_CHARS);
            this.post[i] = new Array(SAMPLE_CHARS);
        }
    }
}


const WORDS_PATH = "words.txt"; 
const I = 127;
const SAMPLE_CHARS = 128;
const SAMPLE_CHARS_EX = 127;

const RANDOM_LENGTH = Math.pow(2, 31);

class CharacterGraph {
    constructor() {
        this.charData = new Array(SAMPLE_CHARS);
        this.processWordList();
    }

    processWordList() {
        for (let i = 0; i < this.charData.length; i++) {
            this.charData[i] = new CData(String.fromCharCode(i));
            let cd =  this.charData[i];
            
            let ri = i * 128 * 4;
            cd.pre[1] = raw_nlp_data_arr.slice(ri, ri += 128);
            cd.pre[0] = raw_nlp_data_arr.slice(ri, ri += 128);
            cd.post[0] = raw_nlp_data_arr.slice(ri, ri += 128);
            cd.post[1] = raw_nlp_data_arr.slice(ri, ri += 128);

            // console.log(cd.pre[1]);
            // console.log(cd.pre[0]);
            // console.log(cd.post[0]);
            // console.log(cd.post[1]);
        }
    }

    nextChar(context, guess, chanceThreshold, accentMap) {
        const cchars = context.split('');
        const clen = context.length;
      
        // c1 is closest preceding char
        let c1 = '\0', c2 = '\0';
        if (clen - 1 >= 0)
            c1 = cchars[clen - 1];
        if (clen - 2 >= 0)
            c2 = cchars[clen - 2];
      
        const ranges = this.calcAdjustedRanges(c1, c2, chanceThreshold, accentMap);
      
        for (let i = 0; i < ranges.length; i++) {
            // console.log(guess + '  ' + ranges[i][0] + '  ' + ranges[i][1]);
            if (guess >= ranges[i][0] && guess < ranges[i][1]) {
                return String.fromCharCode(i);
            }
        }
      
        return '~';
    }

    calcAdjustedRanges(c1, c2, chanceThreshold, accentMap) {
        const adjusted = new Array(SAMPLE_CHARS_EX);
      
        let min = 0;
        let max = 0;
        const c1d = this.charData[c1.charCodeAt(0)];
        const c2d = this.charData[c2.charCodeAt(0)];
        
        const total1 = c1d.post[0][I];
        const total2 = c2d.post[1][I];
      
        for (let i = 0; i < SAMPLE_CHARS_EX; i++) {
            min = max;
      
            const chance1 = (c1d.post[0][i] / total1) * ((accentMap[i] >= 0) ? accentMap[i] : 1);
            const chance2 = (c2d.post[1][i] / total2) * ((accentMap[i] >= 0) ? accentMap[i] : 1);
      
            if (!(chance1 === 0 || chance2 === 0 || chance1 < chanceThreshold || chance2 < chanceThreshold)) {
                max += chance1 + chance2;
            }
      
            adjusted[i] = [min, max];
        }
      
        const downscale = adjusted[SAMPLE_CHARS_EX - 1][1] / 1;
      
        for (let i = 0; i < SAMPLE_CHARS_EX; i++) {
            adjusted[i][0] /= downscale;
            adjusted[i][1] /= downscale;
        }
      
        return adjusted;
    }
}
  
class PseudowordGeneratorV2 {
    constructor() {
        this.rng = new RNG(Number.parseInt(Math.random() * 0x7FFFFFFFFFFFF));
        this.cgraph = new CharacterGraph();
    }
  
    next(root, count, maxLength, chanceThreshold, accentMap) {
        const res = new Array(count);
    
        const randLen = (maxLength & RANDOM_LENGTH) !== 0;
        let maxl = maxLength;
        if (randLen) maxl ^= RANDOM_LENGTH;
        maxLength = maxl;
    
        for (let i = 0; i < count; i++) {
            let cur = root;
    
            if (randLen) 
                maxLength = Math.floor(Math.random() * maxl) + 1;
    
            while (cur.length < maxLength) {
                const add = this.cgraph.nextChar(cur, this.rng.next(), chanceThreshold, accentMap);
                if(add !== "\0" && add !== "~")
                    cur += add;
                else 
                    break;
            }
    
            res[i] = cur;
        }
    
        return res;
    }
}

